// Dithered background + sand particles
(function() {
  // Create canvases
  var ditherCanvas = document.createElement('canvas');
  ditherCanvas.id = 'dither-canvas';
  ditherCanvas.style.cssText = 'position:fixed;top:0;left:0;width:100%;height:100%;pointer-events:none;z-index:0;opacity:0.12;';
  document.body.insertBefore(ditherCanvas, document.body.firstChild);

  var sandCanvas = document.createElement('canvas');
  sandCanvas.id = 'sand-canvas';
  sandCanvas.style.cssText = 'position:fixed;top:0;left:0;width:100%;height:100%;pointer-events:none;z-index:0;opacity:0.4;';
  document.body.insertBefore(sandCanvas, ditherCanvas.nextSibling);

  // Ensure main container is above
  var container = document.querySelector('.container');
  if (container) container.style.position = 'relative';
  if (container) container.style.zIndex = '1';

  // ── Dithered Background ──
  var dctx = ditherCanvas.getContext('2d');
  var img = new Image();
  img.src = 'data:image/webp;base64,';
  img.onload = function() {
    renderDither();
    window.addEventListener('resize', renderDither);
  };

  function renderDither() {
    var w = window.innerWidth;
    var h = window.innerHeight;
    ditherCanvas.width = w;
    ditherCanvas.height = h;

    var ditherScale = 0.5;
    var dw = Math.floor(w * ditherScale);
    var dh = Math.floor(h * ditherScale);

    var off = document.createElement('canvas');
    off.width = dw;
    off.height = dh;
    var octx = off.getContext('2d');

    var oScale = Math.max(dw / img.width, dh / img.height);
    var osw = img.width * oScale;
    var osh = img.height * oScale;
    var osx = (dw - osw) / 2;
    var osy = (dh - osh) / 2;
    octx.drawImage(img, osx, osy, osw, osh);

    var imageData = octx.getImageData(0, 0, dw, dh);
    var data = imageData.data;

    var gray = new Float32Array(dw * dh);
    for (var i = 0; i < dw * dh; i++) {
      var idx = i * 4;
      gray[i] = 0.299 * data[idx] + 0.587 * data[idx + 1] + 0.114 * data[idx + 2];
    }

    // Contrast stretch
    var gMin = 255, gMax = 0;
    for (var i = 0; i < gray.length; i++) {
      if (gray[i] < gMin) gMin = gray[i];
      if (gray[i] > gMax) gMax = gray[i];
    }
    var gRange = gMax - gMin || 1;
    for (var i = 0; i < gray.length; i++) {
      gray[i] = ((gray[i] - gMin) / gRange) * 255;
    }

    // S-curve contrast boost
    for (var i = 0; i < gray.length; i++) {
      var n = gray[i] / 255;
      n = n - 0.5;
      n = n * 1.6;
      n = n / (1 + Math.abs(n));
      n = n + 0.5;
      gray[i] = Math.max(0, Math.min(255, n * 255));
    }

    // Floyd-Steinberg dithering
    for (var y = 0; y < dh; y++) {
      for (var x = 0; x < dw; x++) {
        var i = y * dw + x;
        var old = gray[i];
        var nw = old > 128 ? 255 : 0;
        gray[i] = nw;
        var err = old - nw;
        if (x + 1 < dw) gray[i + 1] += err * 7 / 16;
        if (y + 1 < dh && x > 0) gray[i + dw - 1] += err * 3 / 16;
        if (y + 1 < dh) gray[i + dw] += err * 5 / 16;
        if (y + 1 < dh && x + 1 < dw) gray[i + dw + 1] += err * 1 / 16;
      }
    }

    // Write back as warm-tinted monochrome
    for (var i = 0; i < dw * dh; i++) {
      var idx = i * 4;
      var v = gray[i];
      if (v > 128) {
        data[idx] = 200; data[idx + 1] = 164; data[idx + 2] = 78;
      } else {
        data[idx] = 13; data[idx + 1] = 12; data[idx + 2] = 10;
      }
      data[idx + 3] = 255;
    }

    octx.putImageData(imageData, 0, 0);

    dctx.imageSmoothingEnabled = false;
    dctx.mozImageSmoothingEnabled = false;
    dctx.webkitImageSmoothingEnabled = false;
    dctx.msImageSmoothingEnabled = false;
    dctx.drawImage(off, 0, 0, dw, dh, 0, 0, w, h);
  }

  // ── Sand Particles ──
  var sctx = sandCanvas.getContext('2d');
  var particles = [];
  var count = 40;

  function resizeSand() {
    sandCanvas.width = window.innerWidth;
    sandCanvas.height = window.innerHeight;
  }

  function initSand() {
    resizeSand();
    particles = [];
    for (var i = 0; i < count; i++) {
      particles.push({
        x: Math.random() * sandCanvas.width,
        y: Math.random() * sandCanvas.height,
        vx: 0.15 + Math.random() * 0.3,
        vy: -0.05 + Math.random() * 0.1,
        size: 0.5 + Math.random() * 1,
        opacity: 0.1 + Math.random() * 0.25
      });
    }
  }

  function drawSand() {
    sctx.clearRect(0, 0, sandCanvas.width, sandCanvas.height);
    for (var i = 0; i < particles.length; i++) {
      var p = particles[i];
      p.x += p.vx;
      p.y += p.vy;
      if (p.x > sandCanvas.width + 10) {
        p.x = -10;
        p.y = Math.random() * sandCanvas.height;
      }
      if (p.y < -10 || p.y > sandCanvas.height + 10) {
        p.y = Math.random() * sandCanvas.height;
      }
      sctx.beginPath();
      sctx.arc(p.x, p.y, p.size, 0, Math.PI * 2);
      sctx.fillStyle = 'rgba(200, 164, 78, ' + p.opacity + ')';
      sctx.fill();
    }
    requestAnimationFrame(drawSand);
  }

  initSand();
  drawSand();
  window.addEventListener('resize', resizeSand);

  // ── Scanline overlay ──
  var scanDiv = document.createElement('div');
  scanDiv.style.cssText = 'position:fixed;top:0;left:0;width:100%;height:100%;background:repeating-linear-gradient(0deg,transparent,transparent 2px,rgba(0,0,0,0.015) 2px,rgba(0,0,0,0.015) 4px);pointer-events:none;z-index:999;';
  document.body.appendChild(scanDiv);
})();
